/**
 * @description 增加箱子數量、金額
 * @param {string} count+price
 * @return {{type: int, payload: {count: int, price: int}}} action 物件
 */
export function addBox(count, price) {
    return {
        type: 'buyFashionBox/boxAdded',
        payload: {
            count,
            price
        }
    }
}

/**
 * @description 增加箱子數量、金額
 * @param {string} count
 * @return {{type: int, payload: {count: int, price: int}}} action 物件
 */
export function drawBox(count) {
    return {
        type: 'buyFashionBox/boxDeleted',
        payload: {
            count
        }
    }
}
